import React,{Component} from 'react'
import TextField from '@mui/material/TextField';

class Create extends Component{
  constructor(props) {
    super(props)
    this.state = {
      blogs : [],
      new_blog : ""
    }
  }

  render(){
    return(
      <>
      <h2> Create</h2>
      <TextField
             sx={{

              width: { sm: 200, md: 700 },
              "& .MuiInputBase-root": {
                  height: 80
              }
          }}
          fullWidth
          size="Large"
          id="outlined-multiline-static"
          label="Create your blog "
          multiline
          rows={4}

        />
      </>
    )
  }
}

export default Create
